import React from "react";

class Image extends React.Component {
  style = {
    flex: {
      display: "flex",
      width: "100vw",
      background: "red",
      justifyContent: "center"
    }
  };

  render() {
    const { imagePath } = this.props.match.params;
    return (
      <div style={this.style.flex}>
        <span>sdfdsf</span>
      </div>
    );
  }
}

export default Image;
